#include "zenomlogo.h"

ZenomLogo::ZenomLogo() : ShapedWindow(Monitor::all().w()/2-250, Monitor::all().h()/2-125, 500, 250)
{
	initLogo();
	initLogoShape();

    begin();
    imageWidget = new Widget(0,0,500,250);
    xpm = new xpmImage(zenomLogo,0);
    imageWidget->box(xpm);
    end();

    xbm = new xbmImage (zenomLogoShape, zenomLogoShapeWidth, zenomLogoShapeHeight);
    shape(xbm);
}

ZenomLogo::~ZenomLogo()
{
    delete xbm;
    delete xpm;
    delete imageWidget;
}

